//로그인 화면의 책 전체
import Style from "./Book.module.css";
import Logo from "./Logo";
import MainInnerStuff from "./mainInnerStuff";
import Members from "../../footer/footer";

const Book = () => {
    return(
        <div className={Style.bookCover}>
            <div />
            <div className={Style.book}>


            </div>
            <div />
            <Members />
        </div>
    );
}

export default Book;
